import * as React from "react";
import {
  Chart,
  ScatterSeries,
  Legend,
  ArgumentAxis,
  ValueAxis,
} from "@devexpress/dx-react-chart-material-ui";
import { Animation, ArgumentScale } from "@devexpress/dx-react-chart";
import { scaleBand } from "d3-scale";

const Label = React.memo((props) => {
  return <ArgumentAxis.Label {...props} text={props.text.toLocaleString()} />;
});

const TeacherGraph = (props) => {
  return (
    <Chart data={props.data} className="w-100">
      {/* <ArgumentAxis /> */}

      <ValueScale factory={scaleBand} />
      <ArgumentAxis labelComponent={Label} />
      <ScatterSeries
        name="Serie predefinita1"
        valueField="val1"
        argumentField="arg1"
      />
      <ScatterSeries
        name="Serie predefinita2"
        valueField="val2"
        argumentField="arg2"
      />
      <Legend position="bottom" />
      <Animation />
    </Chart>
  );
};

export default TeacherGraph;
